    }
  }

  render() {
    return (
      <div className={this.props.mobile.formIsOpen ? styles['notDisplayed'] : styles["preview"]} id>
        <HeaderPreview 
          info={this.props.info}
          experience={this.props.experience} />
        <div className={styles['info']}>
          <EducationalPreview 
            info={this.props.info}
            skills={this.props.skills} />
